        <>
        <div className='bodyleader'>

            <main>

                <div id="header">
                <h1>Leader Board</h1>
            
            </div>
            <div id="leaderboard">
                <div class="ribbon"></div>
                <table>
                {/* <thead>
                    <tr>
                        <th>Team Name</th>
                        <th>Timing</th>
                        <th>Missing Laps</th>
                    </tr>
                </thead> */}
                <tbody>
                    {teams.map((team) => (
                        <tr key={team.id}>
                            <td class="name">{team.team_name}</td>
                            <td class="number">{team.timing}</td>
                            <td className='points'>{team.missing_laps}</td>
                        </tr>
                    ))}
                </tbody>
                {/* <tr>
                    <td class="number">1</td>
